import React from 'react';
import Header from '../components/Header';
import SideBar from '../components/SideBar';

const Aula1 = () => {
  const arrayConteudo = ['conteudo 1', 'conteudo 2', '...', 'conteudo N'];
  return (
    <div>
      <Header />
      <SideBar listaConteudo={ arrayConteudo }/>
      <h2> Nosso conteúdo:</h2>
      <p>Um componente importante para a engenharia elétrica, sem dúvidas é o transformador.</p>
      <p>Responsável pela a mudança de tensão entre dois pontos, por exemplo, trazer a tensão de 220V para 110V,
        será apresentado de forma introdutória nessa aula.
      </p>
    </div>
  );
};

export default Aula1;
